import React from 'react';
import Card from './Card';

const Cardlist = ({props}) => {
	return (
		<div>
			<Card id={props[0].id} name={props[0].name} email={props[0].email}/>
			<Card id={props[1].id} name={props[1].name} email={props[1].email}/>
			<Card id={props[2].id} name={props[2].name} email={props[2].email}/>
		</div>
	);
}

export default Cardlist;
